import React from "react";
import {
  Box,
  Container,
  Grid,
  Typography,
  TextField,
  Button,
  Paper,
} from "@mui/material";
import { motion } from "framer-motion";
import SendIcon from "@mui/icons-material/Send";
import EmailIcon from "@mui/icons-material/Email";
import PersonIcon from "@mui/icons-material/Person";

const fadeLeft = {
  hidden: { opacity: 0, x: -60 },
  visible: { opacity: 1, x: 0, transition: { duration: 0.8 } },
};

const fadeRight = {
  hidden: { opacity: 0, x: 60 },
  visible: { opacity: 1, x: 0, transition: { duration: 0.8 } },
};

const floatAnim = {
  animate: {
    y: [0, -15, 0],
    transition: { duration: 4, repeat: Infinity, ease: "easeInOut" },
  },
};

export default function Contact() {
  return (
    <Box
      sx={{
        minHeight: "100vh",
        py: 10,
        background: "linear-gradient(135deg,#e0f7fa,#ffffff)",
      }}
    >
      <Container maxWidth="lg">
        <Grid container spacing={6} alignItems="center">

          {/* LEFT GIF SECTION */}
          <Grid item xs={12} md={6}>
            <motion.div initial="hidden" whileInView="visible" variants={fadeLeft}>
              <Typography variant="h3" fontWeight="bold" gutterBottom>
                Get in Touch
              </Typography>

              <Typography color="text.secondary" sx={{ mb: 4 }}>
                Have questions or want to book an appointment?  
                Our team is ready to help you restore movement and live pain-free.
              </Typography>

              <motion.img
                variants={floatAnim}
                animate="animate"
                src="https://media.giphy.com/media/3o7TKMt1VVNkHV2PaE/giphy.gif"
                alt="Contact GIF"
                style={{
                  width: "100%",
                  maxWidth: "450px",
                  borderRadius: "20px",
                  boxShadow: "0 20px 40px rgba(0,0,0,0.15)",
                }}
              />
            </motion.div>
          </Grid>

          {/* RIGHT FORM SECTION */}
          <Grid item xs={12} md={6}>
            <motion.div initial="hidden" whileInView="visible" variants={fadeRight}>
              <Paper
                elevation={6}
                sx={{
                  p: 5,
                  borderRadius: 4,
                  backdropFilter: "blur(10px)",
                  background: "rgba(255,255,255,0.85)",
                }}
              >
                <Typography variant="h4" fontWeight="bold" gutterBottom>
                  Contact Us
                </Typography>

                <Box component="form" sx={{ mt: 3 }}>

                  <Box sx={{ display: "flex", alignItems: "center", gap: 1, mb: 2 }}>
                    <PersonIcon color="primary" />
                    <TextField fullWidth label="Name" />
                  </Box>

                  <Box sx={{ display: "flex", alignItems: "center", gap: 1, mb: 2 }}>
                    <EmailIcon color="primary" />
                    <TextField fullWidth label="Email" />
                  </Box>

                  <TextField
                    fullWidth
                    label="Message"
                    multiline
                    rows={4}
                    sx={{ mb: 3 }}
                  />

                  <motion.div whileHover={{ scale: 1.05 }} whileTap={{ scale: 0.95 }}>
                    <Button
                      fullWidth
                      variant="contained"
                      size="large"
                      endIcon={<SendIcon />}
                      sx={{
                        py: 1.5,
                        borderRadius: "30px",
                        background: "linear-gradient(135deg,#009688,#26c6da)",
                        boxShadow: "0 10px 25px rgba(0,150,136,0.4)",
                        fontSize: "1.1rem",
                      }}
                    >
                      Send Message
                    </Button>
                  </motion.div>
                </Box>
              </Paper>
            </motion.div>
          </Grid>
        </Grid>
      </Container>
    </Box>
  );
}
